import React, {Component} from 'react'
import './style.css'

class List extends Component{
  render(){
    return (
      <ul className="list">
        <li>
          <i className='quan'></i>
          <p>asdasasdas</p>
          <em className='del'></em>
        </li>
      </ul>
    )
  }
}

export default List
